import React from 'react'
import { useNavigate } from 'react-router-dom'

const Login = () => {
  useNavigate

  function handleClick(){
    console.log('Fazer login')
  }

  return (
    <div>
      <h1>Login</h1>
      <button onClick={handleClick}>Fazer Login</button>
    </div>
  )
}

export default Login
